import { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion'
import * as H from '../css/headerstyle'

const top = {
    closed: {
      rotate: 0,
      translateY: 0
    },
    opened: {
      rotate: 45,
      translateY: 2,
    }
  };
  const center = {
    closed: {
      opacity: 1
    },
    opened: {
      opacity: 0
    }
  };
  const bottom = {
    closed: {
      rotate: 0,
      translateY: 0
    },
    opened: {
      rotate: -45,
      translateY: -2,
    }
  };

 
const Header = () => {

    const [toggle, setToggle] = useState(false);

    

    return (
        <>
            <H.Navbar>
                <H.MenuBars onClick={()=> setToggle(!toggle)}>
                    <motion.div animate={toggle ? "opened" : "closed"} variants={top}><H.BarTop></H.BarTop></motion.div>
                    <motion.div animate={toggle ? "opened" : "closed"} variants={center}><H.BarCenter width={toggle}></H.BarCenter></motion.div>
                    <motion.div animate={toggle ? "opened" : "closed"} variants={bottom}><H.BarBottom width={toggle}></H.BarBottom></motion.div>
                </H.MenuBars>
                <H.LogoWrapper>
                    DinerApp
                </H.LogoWrapper>
                <H.MenuNavbar>
                    <H.Atag> Contacto</H.Atag>
                    <H.Atag> Restaurantes</H.Atag>
                    <H.Atag> Bares</H.Atag>
                </H.MenuNavbar>
            </H.Navbar>
        </>
     );
}
 
export default Header;
